import { Component, inject } from '@angular/core';
import { NgForm } from '@angular/forms';
import { AuthService } from '../Services/auth.service';
import { Observable } from 'rxjs';
import { AuthResponse } from "../Model/AuthResponse";
import { Router } from '@angular/router';
import { CounterService } from '../Services/counter.service';

@Component({
  selector: 'app-login',
  templateUrl: './login.component.html',
  styleUrls: ['./login.component.css']
})
export class LoginComponent {
  authService: AuthService = inject(AuthService);
  isLoginMode: boolean = true;
  isLoading: boolean = false;
  errorMessage: string | null = null;
  authObs: Observable<AuthResponse>;
  router: Router = inject(Router);
  countService: CounterService = inject(CounterService);

  ngOnInit(){
    this.countService.increment('LoginComponent');
  }

  onSwitchMode(){
    this.isLoginMode = !this.isLoginMode;
  }

  onFormSubmitted(form: NgForm){
    const email = form.value.email;
    const password = form.value.password;

    if(this.isLoginMode){
      this.isLoading = true;
      this.authObs = this.authService.login(email, password);
    }else{
      this.isLoading = true;
      this.authObs = this.authService.signup(email, password);
    }

    this.authObs.subscribe({
      next: (res) => { 
        console.log(res);
        this.isLoading = false; 
        this.router.navigate(['/dashboard/overview']);
      },
      error: (errMsg) => { 
        this.isLoading = false;

        this.errorMessage = errMsg;
        this.hideSnackbar();
      }
    })
    form.reset();
  }

  hideSnackbar(){
    setTimeout(() => {
      this.errorMessage = null;
    }, 3000);
  }
}
<div class="app-login-form">
    <app-snackbar [errorMessage]="errorMessage" *ngIf="errorMessage"></app-snackbar>
    <h2>{{ isLoginMode ? 'Login' : 'Signup'}} Here</h2>
    <app-loader *ngIf="isLoading"></app-loader>
    <form #authForm="ngForm" (ngSubmit)="onFormSubmitted(authForm)" *ngIf="!isLoading">
        <div class="form-input">
            <label>Email Address</label>
            <input type="email" 
                placeholder="Email address" 
                name="email" 
                ngModel
                required
                email
            >
        </div>
        <div class="form-input">
            <label>Password</label>
            <input type="password" 
                placeholder="Password" 
                name="password" 
                ngModel
                required
                minlength="8"
            >
        </div>           
        <button type="submit" 
            class="app-login-btn"
            [disabled]="authForm.invalid"
        >{{ isLoginMode ? 'Login' : 'Signup'}}</button>
        <p>{{isLoginMode ? 'Do not have an accout yet?' : 'Already have an account?'}}
            <button 
                class="app-toggle-btn" 
                type="button" 
                (click)="onSwitchMode()"
            >{{isLoginMode ? 'Register Here.' : 'Login Here'}}</button>
        </p>
    </form>
</div>
